class Solution(object):
    def checkPerfectNumber(self, num):
        """
        :type num: int
        :rtype: bool
        """

        # 1. 找到所有的因子
        # 2. 检查因子的和是否等于num
        # 3. 如果因子的和等于num，则返回true
        # 4. 如果因子的和不等于num，则返回false

        # 1. 找到所有的因子
        factors = []
        for i in range(1, int(num**0.5) + 1):
            if num % i == 0:
                factors.append(i)
                if i*i != num:
                    factors.append(num // i)

        # 2. 检查因子的和是否等于num
        sum = 0
        for factor in factors:
            sum += factor
        if sum == num:
            return True
        else:
            return False

