class Solution(object):
    def calculateMinimumHP(self, dungeon):
        """
        :type dungeon: List[List[int]]
        :rtype: int
        """

        # Initialize the dp array
        dp = [[0] * len(dungeon[0]) for _ in range(len(dungeon))]

        # Initialize the dp array
        dp[len(dungeon) - 1][len(dungeon[0]) - 1] = max(1, 1 - dungeon[len(dungeon) - 1][len(dungeon[0]) - 1])

        # Fill the dp array
        for i in range(len(dungeon) - 2, -1, -1):
            for j in range(len(dungeon[0]) - 2, -1, -1):
                if i == len(dungeon) - 2 and j == len(dungeon[0]) - 2:
                    dp[i][j] = max(1, 1 - dungeon[i][j])
                elif i == len(dungeon) - 2:
                    dp[i][j] = max(1, dp[i][j + 1] - dungeon[i][j])
                elif j == len(dungeon[0]) - 2:
                    dp[i][j] = max(1, dp[i + 1][j] - dungeon[i][j])
                else:
                    dp[i][j] = max(1, min(dp[i + 1][j], dp[i][j + 1]) - dungeon[i][j])

        return dp[0][0]

