    def swimInWater(self, grid):
        """
        :type grid: List[List[int]]
        :rtype: int
        """

        # BFS
        # 1. find the lowest point
        # 2. find the shortest path to the lowest point
        # 3. find the shortest path to the bottom right

        # find the lowest point
        lowest = 0
        for i in range(len(grid)):
            for j in range(len(grid[0])):
                if grid[i][j] < lowest:
                    lowest = grid[i][j]

        # find the shortest path to the lowest point
        queue = [(0, 0, 0)]
        visited = set()
        while queue:
            i, j, t = queue.pop(0)
            if i == lowest:
                break
            for di, dj in [(0, 1), (0, -1), (1, 0), (-1, 0)]:
                ni, nj = i + di, j + dj
                if 0 <= ni < len(grid) and 0 <= nj < len(grid[0]) and grid[ni][nj] <= t and (ni, nj) not in visited:
                    queue.append((ni, nj, t + 1))
                    visited.add((ni, nj))

        # find the shortest path to the bottom right
        queue = [(lowest, 0, 0)]
        visited = set()
        while queue:
            i, j, t = queue.pop(0)
            if i == len(grid) - 1 and j == len(grid[0]) - 1:
                return t
            for di, dj in [(0, 1), (0, -1), (1, 0), (-1, 0)]:
