class Solution(object):
    def lengthOfLastWord(self, s):
        """
        :type s: str
        :rtype: int
        """

        # 1. 先去掉字符串中的空格
        s = s.strip()

        # 2. 如果字符串为空，返回0
        if not s:
            return 0

        # 3. 找到最后一个空格的位置
        last_space_index = s.rfind(' ')

        # 4. 如果最后一个空格的位置为-1，说明最后一个单词是整个字符串
        if last_space_index == -1:
            return len(s)

        # 5. 如果最后一个空格的位置不为-1，说明最后一个单词是字符串中的一部分
        else:
            return len(s[last_space_index+1:])

class Solution(object):
