        """
        :type n: int
        :rtype: bool
        """

        # 1. 快速排除
        if n == 1:
            return True
        if n == 2:
            return False

        # 2. 循环检查
        seen = set()
        while n != 1:
            if n in seen:
                return False
            seen.add(n)
            n = self.sumSquare(n)
        return True

