    def maxProfit(self, prices):
        """
        :type prices: List[int]
        :rtype: int
        """

        # 1. 找到最低价格
        min_price = 1000000000
        for i in range(len(prices)):
            if prices[i] < min_price:
                min_price = prices[i]

        # 2. 找到最高价格
        max_price = 0
        for i in range(len(prices)):
            if prices[i] > max_price:
                max_price = prices[i]

        # 3. 计算最大利润
        profit = 0
        for i in range(len(prices)):
            if prices[i] > max_price:
                profit += prices[i] - max_price
            elif prices[i] < min_price:
                min_price = prices[i]

        return profit

