    def isPerfectSquare(self, num):
        """
        :type num: int
        :rtype: bool
        """

        # 1. 二分查找
        left, right = 1, num
        while left <= right:
            mid = (left + right) // 2
            if mid * mid == num:
                return True
            elif mid * mid > num:
                right = mid - 1
            else:
                left = mid + 1
